/*!

=========================================================
* BLK Design System React - v1.2.0
=========================================================

* Product Page: https://www.creative-tim.com/product/blk-design-system-react
* Copyright 2020 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/blk-design-system-react/blob/main/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";
import { Link } from "react-router-dom";
//import classnames from "classnames";
// react plugin used to create datetimepicker
//import ReactDatetime from "react-datetime";

// reactstrap components
import {
  Button,
  Container,
  Row,
  Col,
  Modal,
  UncontrolledCarousel,
} from "reactstrap";

const carouselItems = [
  {
    src: require("assets/img/landing-bg.jpg").default,
    altText: "Slide 1",
    caption: "",
  },
  {
    src: require("assets/img/landing-bg.jpg").default,
    altText: "Slide 2",
    caption: "",
  },
  {
    src: require("assets/img/landing-bg.jpg").default,
    altText: "Slide 3",
    caption: "",
  },
  {
    src: require("assets/img/landing-bg.jpg").default,
    altText: "Slide 4",
    caption: "",
  },

];

export default function JavaScript() {
  const [demoModal, setDemoModal] = React.useState(false);
  //const [miniModal, setMiniModal] = React.useState(false);
  //const [formModal, setFormModal] = React.useState(false);
  //const [emailFocus, setEmailFocus] = React.useState(false);
  //const [passwordFocus, setPasswordFocus] = React.useState(false);
  return (
    <div className="section section-javascript" id="javascriptComponents">
      <img
        alt="..."
        className="path"
        src={require("assets/img/path5.png").default}
      />
      <img
        alt="..."
        className="path path1"
        src={require("assets/img/path5.png").default}
      />
      <Container>
        <h3 className="title mb-5">PLAZAS DE TRABAJO A LAS QUE PUEDES POSTULARTE</h3>
        <h4 className="mb-5">PLAZAS</h4>
        <Row id="modals">
          <Col md="4">
            <Button color="primary" onClick={() => setDemoModal(true)}>
              Launch Modal
            </Button>
          </Col>

          {/* Sart Demo Modal */}
          <Modal isOpen={demoModal} toggle={() => setDemoModal(false)}>
            <div className="modal-header justify-content-center">
              <button className="close" onClick={() => setDemoModal(false)}>
                <i className="tim-icons icon-simple-remove" />
              </button>
              <h4 className="title title-up">Modal title</h4>
            </div>
            <div className="modal-body">
              <p>
                Far far away, behind the word mountains, far from the countries
                Vokalia and Consonantia, there live the blind texts. Separated
                they live in Bookmarksgrove right at the coast of the Semantics,
                a large language ocean. A small river named Duden flows by their
                place and supplies it with the necessary regelialia. It is a
                paradisematic country, in which roasted parts of sentences fly
                into your mouth.
              </p>
            </div>
            <div className="modal-footer">
              <Button color="default" type="button">
                Nice Button
              </Button>
              <Button
                color="danger"
                type="button"
                onClick={() => setDemoModal(false)}
              >
                Close
              </Button>
            </div>
          </Modal>
          {/* End Demo Modal */}


        </Row>


      </Container>
      <div className="section">
        <Container>
          <Row className="justify-content-between align-items-center">
            <Col className="mb-5 mb-lg-0" lg="5">
              <h1 className="text-white font-weight-light">
                CAROUSEL DE PLAZAS
              </h1>
              <p className="text-white mt-4">
                Puedes ver la variedad de plazas abiertas a las que puedes aplicar. 
                Revisa los requisitos y no dudes en postularte. 
                Pronto uno de nuestros reclutadores, se pondrá en contacto contigo para revisar tu postulación.
              </p>
              <Button
                className="mt-4"
                color="warning"
                to="register-page" tag={Link}
              >
                POSTULARME
              </Button>
            </Col>
            <Col lg="6">
              <UncontrolledCarousel
                items={carouselItems}
                indicators={false}
                autoPlay={false}
              />
            </Col>
          </Row>
        </Container>
      </div>
    </div>
  );
}
